import Head from "next/head";
import styles from "./layout.module.css";
import utilStyles from "../styles/utils.module.css";
import Link from "next/link";

const name = "Shea";

export const siteTitle = "Moody";

function Layout({ children, home }) {
  return (
    <div className={styles.container}>
      <Head>
        <link rel="icon" href="/favicon.ico" />
        <meta
          name="description"
          content="Mood"
        />
        <meta
          property="og:image"
          content={`https://og-image.now.sh/${encodeURI(
            siteTitle
          )}.png?theme=light&md=0&fontSize=75px&images=https%3A%2F%2Fassets.vercel.com%2Fimage%2Fupload%2Ffront%2Fassets%2Fdesign%2Fnextjs-black-logo.svg`}
        />
        <meta name="og:title" content={siteTitle}/>
        <meta name="twitter:card" content="cummary_large_image" /> 
      </Head>
      <header className={styles.header}>
          {home ? (
            <>
                <img
                    src="/images/profile.jpg"
                    className={`${styles.headerHomeImage} ${utilStyles.borderCircle}`}
                    alt ={name}
                />
                <h1 className ={utilStyles.header}>{name}</h1>
            </>
          ) : (
            <>
                <Link href="/">
                    <a>
                        <img
                            src="/images/profile.jpg"
                            className={`${styles.headerImage} ${utilStlyes.borderCircle}`}
                            alt={name}
                        />
                    </a>
                </Link>
                <h2 className={utilStylesStyles.headingLg}>
                    <Link href="/">
                        <a className={utilStyles.colorInherit}>{name}</a>
                    </Link>
                </h2>
            </>
          )}
      </header>
      <main>{children}</main>
      {!home && (
          <div className={styles.backToHome}>
              <Link href="/">
                  <a>‚Üê Back to home</a>
              </Link>
          </div>
      )}
    </div>
  );
}

export default Layout;
